    false,nt"url": null,nt"notes": "This annual narrative report for Swan Lake
    National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses management planning, public
    participation, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, funding, and safety is given. Habitat
    management is also covered; subjects include wetlands, croplands, grasslands, fire
    management, and wilderness areas. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, wildlife propagation, animal
    control, and marking and bird banding. The public uses of the Refuge described in
    this report include interpretive programs, hunting, fishing, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, and equipment
    replacement. Items of interest are provided at the end. Refuge brochures are attached.",nt"license_title":
